description:
&quot;All woman have secrets. Some much deeper than others. But for the woman who has had to hide her true feelings of sexuality the coming out process can be both terrifying and exhilarating at the same time. Meet Nikki Hearts a young queer girl who tells her family she likes girls not boys. Or the case of Ashlyn who discovers the joy of another woman while on a summer trip to Europe. Aidra the gold digger who ends up having sex with her man's daughter. And the classic spoiled housewife who hooks up with an old friend that introduces her to the world of lesbian love.&quot;

Celeste Star, Ela Darling, Nikki Hearts, Jessa Rhodes, Cassie Lane, Aidra Fox, Sinn Sage, Ashlyn Molloy

